import axios from "axios";

const TODO_API_BASE_URL = "http://localhost:8080/color";

export const getColor = () => axios.get(TODO_API_BASE_URL);

export const clickColor = (coloerId) =>
  axios.post(
    TODO_API_BASE_URL,
    { coloerId: coloerId },
    {
      headers: {
        "Content-Type": "application/json",
      },
    }
  );
